import React from "react";
import "./styles.css";
function Home() {
  return (
    <div className="home-container">
      <div className="background-picture-wrapper">
        <img
          className="background-picture"
          href="../images/pizza.jpg"
          alt="alternanitv"
        />
      </div>
    </div>
  );
}

export default Home;
